import { useSelector } from "react-redux";

const TodoList = () => {
  const undoTodoList = useSelector((state) => state.undoneTodoList.list);

  return (
    <div>
      <ul>
        {undoTodoList.map((it) => {
          return <li>it</li>;
        })}
      </ul>
    </div>
  );
};

export default TodoList;
